import React, { useState, useEffect } from 'react';
import { Button, ButtonGroup, Card, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const TestMenu = () => {
    const [productsByCategory, setProductsByCategory] = useState({});
    const [filteredProducts, setFilteredProducts] = useState({});
    const [selectedCategory, setSelectedCategory] = useState('All');
    const [filters, setFilters] = useState({ type: '', price: '' });

    // Fetch products from backend server
    useEffect(() => {
        const fetchProducts = async () => {
            try {
                const response = await fetch('http://localhost:4000/api/products');
                if (!response.ok) throw new Error('Failed to fetch products');
                const data = await response.json();
                organizeByCategory(data.data.product_list || []);
            } catch (error) {
                console.error('Error fetching products:', error);
            }
        };
        fetchProducts();
    }, []);

    const organizeByCategory = (products) => {
        const categories = products.reduce((acc, product) => {
            const category = product.category_type || 'Uncategorized';
            if (!acc[category]) acc[category] = [];
            acc[category].push(product);
            return acc;
        }, {});
        setProductsByCategory(categories);
        setFilteredProducts(categories);
    };

    const handleCategoryClick = (category) => {
        setSelectedCategory(category);
        setFilteredProducts({
            [category]: productsByCategory[category],
        });
    };

    const applyFilters = (type, price) => {
        const filtered = {};
        Object.keys(productsByCategory).forEach((category) => {
            filtered[category] = productsByCategory[category].filter((product) => {
                const matchesType = type ? product.type === type : true;
                const matchesPrice = price
                    ? price === 'low'
                        ? product.pricing.price_sell < 50
                        : product.pricing.price_sell >= 50
                    : true;
                return matchesType && matchesPrice;
            });
        });
        setFilteredProducts(filtered);
    };

    const handleFilterChange = (filterType, value) => {
        setFilters((prevFilters) => ({ ...prevFilters, [filterType]: value }));
        applyFilters(filterType === 'type' ? value : filters.type, filterType === 'price' ? value : filters.price);
    };

    return (
        <div className="container my-4">
            <h2 className="mb-4">Vendor Menu</h2>

            {/* Category Navigation */}
            <div className="d-flex overflow-auto mb-3">
                <ButtonGroup>
                    {Object.keys(productsByCategory).map((category) => (
                        <Button
                            key={category}
                            variant="outline-primary"
                            onClick={() => handleCategoryClick(category)}
                            className={selectedCategory === category ? 'active' : ''}
                        >
                            {category}
                        </Button>
                    ))}
                </ButtonGroup>
            </div>

            {/* Filter Options */}
            <div className="d-flex justify-content-between mb-3">
                <ButtonGroup>
                    <Button variant="outline-secondary" onClick={() => handleFilterChange('type', 'Sativa')}>Sativa</Button>
                    <Button variant="outline-secondary" onClick={() => handleFilterChange('type', 'Indica')}>Indica</Button>
                    <Button variant="outline-secondary" onClick={() => handleFilterChange('type', 'Hybrid')}>Hybrid</Button>
                </ButtonGroup>
                <ButtonGroup>
                    <Button variant="outline-secondary" onClick={() => handleFilterChange('price', 'low')}>Price &lt; $50</Button>
                    <Button variant="outline-secondary" onClick={() => handleFilterChange('price', 'high')}>Price â‰¥ $50</Button>
                </ButtonGroup>
            </div>

            {/* Display Products by Category */}
            {Object.keys(filteredProducts).map((category) => (
                <div key={category}>
                    <h3 className="mt-4">{category}</h3>
                    <Row>
                        {filteredProducts[category]?.map((product) => (
                            <Col md={4} key={product.product_id} className="mb-4">
                                <Card>
                                    <Card.Img
                                        variant="top"
                                        src={product.e_commerce?.primary_image || 'https://via.placeholder.com/100'}
                                        alt={product.product_configurable_fields.name}
                                        style={{ height: '150px', objectFit: 'cover' }}
                                    />
                                    <Card.Body>
                                        <Card.Title>{product.product_configurable_fields.name}</Card.Title>
                                        <Button variant="primary">
                                            ${product.pricing.price_sell} + Add to Cart
                                        </Button>
                                    </Card.Body>
                                </Card>
                            </Col>
                        ))}
                    </Row>
                </div>
            ))}
        </div>
    );
};

export default TestMenu;
